import React from "react";

export default function FloatingActionButton({ onClick }: { onClick?: () => void }) {
  return (
    <button
      onClick={onClick}
      style={{
        position: "fixed",
        right: 24,
        bottom: 80,
        width: 56,
        height: 56,
        borderRadius: "50%",
        background: "#ff4081",
        color: "#fff",
        fontSize: 36,
        border: "none",
        boxShadow: "0 2px 8px rgba(0,0,0,0.15)",
        zIndex: 200,
        cursor: "pointer",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
      }}
      aria-label="캐릭터 만들기"
    >
      +
    </button>
  );
}
